import { Link } from 'react-router-dom'
import styled from 'styled-components'

const Div = styled.div`
    height: 100%;
    display: flex;
    flex-direction: column;
    justify-content: top;
    align-items: center;

    h1{
        margin-top: 10%;
    }

    div{
        border-style: solid;
        display: grid;
        grid-template-columns: 8em 8em 8em;
    }

    button{
        margin: 5em;
        height: 5em;
        width: 5em;
    }
`;

const Main = () => {
    return (
        <Div>
            <h1>Main Menu</h1>
            <div>
                <Link to='/manage'><button>Manage</button></Link>
                <Link to='/picking'><button>Picking</button></Link>
                <Link to='/packing'><button>Packing</button></Link>
                <Link to='/packing'><button>Order Counter</button></Link>
                <Link to='/login'><button>Login</button></Link>
            </div>
        </Div>
    )
}

export default Main
